import React from 'react';
import './Cardcomponent.css';
import { Container, Row, Col } from 'reactstrap';

//import { Card } from 'reactstrap';
const Cardcomponent = () => {
    return (
        <Container className="containerborder">
        <Row>
        <Col xs="3">.col-6</Col>
        <Col xs="9">.col-6</Col>
      </Row>
      </Container>
    )

  }


export default Cardcomponent;
